import './App.css';
import data from './endorsements-2020.csv';
import Table from "./Table"
var React = require("react")
var d3 = require("d3")

class App extends React.Component {

  componentWillMount() {
    d3.csv(data)
      .then(data => {
        console.log(data)
      })
  }

  render() {
    return (
      <div className="App">
      <Table />
      </div>
    );
  }
}

export default App;
